import Home from './comonent/Home';

const App = ()=>{
  const Data = "Second Activity";
  return(

    <View>

      <Text style={{fontSize:40,margin:10,alignContent:'center',flex:1,textAlign:'center'}} >
        <Home data = {Data}/>
      </Text>
    </View>
  )
}

export default App;
